var title_f13_60_14282="SLE CT scan showing ground glass";
var content_f13_60_14282=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RADIOL%2F88483%7ERADIOL%2F88484&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RADIOL%2F88483%7ERADIOL%2F88484&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 610px\">",
"   <div class=\"ttl\">",
"    Ground glass pulmonary changes on computerized tomography imaging in systemic lupus erythematosus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 590px; height: 489px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The axial CT image from a 40-year-old female with systemic lupus erythematosus shows a subsegmental region of ground glass change (arrow) in the posterior segment of the right lower lobe. In the posterior segment of the left lower lobe, there is a focal parenchymal infiltrate with an air bronchogram (arrowhead).",
"    <div class=\"footnotes\">",
"     CT: computerized tomography.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 619px\">",
"   <div class=\"ttl\">",
"    Acute pneumonitis on chest radiography and computerized tomography imaging in systemic lupus erythematosus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 599px; height: 240px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The chest x-ray performed on this 41-year-old female shows a diffuse interstitial pattern, and the CT scan through the chest shows multicentric ground glass changes centered around the bronchovascular bundle compatible with acute lupus pneumonitis.",
"    <div class=\"footnotes\">",
"     CT: computerized tomography.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
