var title_f13_60_14283="Sensitivity of human organs or tissues to ionizing radiation";
var content_f13_60_14283=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F68401&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F68401&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Sensitivity of human organs or tissues to ionizing radiation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Relative radiosensitivity",
"       </td>",
"       <td class=\"subtitle1\">",
"        Organ or tissue",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Very high",
"       </td>",
"       <td>",
"        Embryonic tissue, lymphoid organs, bone marrow, blood, testes and ovaries, small intestines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High",
"       </td>",
"       <td>",
"        Skin, lens and cornea of eye, most gastrointestinal organs (oral cavity, esophagus, stomach, rectum), bladder, uterus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medium",
"       </td>",
"       <td>",
"        Growing cartilage, growing bones, blood vessels",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Low",
"       </td>",
"       <td>",
"        Mature cartilage or bone, pituitary gland, lungs, thyroid, pancreas, kidneys, adrenal glands",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Very low",
"       </td>",
"       <td>",
"        Brain, spinal cord, muscles",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Rubin P, Casarett GW. Clinical Radiation Pathology. Philadelphia; W.B. Saunders; 1968.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
