var title_f13_60_14284="Boston criteria CAA";
var content_f13_60_14284=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F53541&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F53541&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Boston criteria for CAA-related hemorrhage",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Classic Boston criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        <strong>",
"         Definite CAA",
"        </strong>",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Full postmortem examination demonstrating:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lobar, cortical, or corticosubcortical hemorrhage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Severe CAA with vasculopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Absence of other diagnostic lesion",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        <strong>",
"         Probable CAA with supporting pathology",
"        </strong>",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Clinical data and pathologic tissue (evacuated hematoma or cortical biopsy) demonstrating:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lobar, cortical, or corticosubcortical hemorrhage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Some degree of CAA in specimen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Absence of other diagnostic lesion",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        <strong>",
"         Probable CAA",
"        </strong>",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Clinical data and MRI or CT demonstrating:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Multiple hemorrhages restricted to lobar, cortical, or corticosubcortical regions (cerebellar hemorrhage allowed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age &ge;55 y",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Absence of other cause of hemorrhage",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        <strong>",
"         Possible CAA",
"        </strong>",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Clinical data and MRI or CT demonstrating:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Single lobar, cortical, or corticosubcortical hemorrhage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age &ge;55 y",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Absence of other cause of hemorrhage",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CAA: cerebral amyloid angiopathy.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Linn J, Halpin A, Demaerel P, et al. Prevalence of superficial siderosis in patients with cerebral amyloid angiopathy. Neurology 2010; 74:1346. Copyright &copy; 2010 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
