var title_f13_60_14285="Abx prophylaxis regimens";
var content_f13_60_14285=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F54121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F54121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antibiotic regimens: Prophylaxis for endoscopic procedures",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Procedure",
"       </td>",
"       <td class=\"subtitle1\">",
"        Condition(s)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antibiotic and dose*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        PEG placement",
"       </td>",
"       <td>",
"        MRSA risk absent",
"       </td>",
"       <td>",
"        Cefazolin 1 gram (pediatric dose 50 mg/kg) IV within&nbsp;30 minutes before procedure.",
"        <strong>",
"         If penicillin or cephalosporin hypersensitivity:",
"        </strong>",
"        Clindamycin 600 mg (pediatric dose 20 mg/kg) IV within 30 minutes before procedure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MRSA risk present",
"       </td>",
"       <td>",
"        Pre-procedural MRSA screening and attempt decolonization. (If successful decolonization not completed: Vancomycin 1 gram [pediatric dose 15 mg/kg] IV infused over 60 to 90 minutes to conclude within 30 minutes prior to procedure.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        ERCP",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         - Biliary obstruction AND cholangitis",
"        </p>",
"        <p>",
"         - Biliary obstruction unlikely to be successfully drained at ERCP (including malignant hilar obstruction and primary sclerosing cholangitis)",
"        </p>",
"        <p>",
"         - Inadequate biliary drainage following ERCP",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Ciprofloxacin 500 mg (pediatric dose 15 mg/kg&loz;) orally given 30 to 60 minutes prior to procedure or 400 mg (pediatric dose 15 mg/kg&loz;) IV within 30 minutes prior to procedure",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         Amoxicillin-clavulate 1750 mg (pediatric dose 45 mg/kg) orally 30 to 60 minutes prior to procedure or ampicillin-sulbactam 3 grams (pediatric dose 50 mg/kg ampicillin component) IV within 30 minutes prior to procedure",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ampicillin 2 grams (pediatric dose 50 mg/kg) IV",
"        <strong>",
"         plus",
"        </strong>",
"        gentamicin 1.5 mg/kg (maximum 120 mg) IV 30 minutes before procedure.",
"        <strong>",
"         If penicillin hypersensitivity:",
"        </strong>",
"        Substitute vancomycin 1 gram (pediatric dose 15 mg/kg) IV infused over 60 to 90 minutes to conclude within 30 minutes prior to procedure plus gentamicin 1.5 mg/kg IV (maximum 120 mg) 30 minutes before procedure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         ALL",
"        </strong>",
"        above regimens are discontinued post-procedure when drainage is established absent evidence of cholangitis. For post-procedure dosing, see each drug information topic.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        ERCP or EUS-FNA of cystic lesion(s)",
"       </td>",
"       <td>",
"        <p>",
"         - Sterile pancreatic cysts",
"        </p>",
"        <p>",
"         - Cysts outside pancreas (excluding solid lesions)",
"        </p>",
"       </td>",
"       <td>",
"        Ciprofloxacin 500 mg orally (pediatric dose 15 mg/kg&loz;) 30 to 60 minutes prior to procedure or 400 mg (pediatric dose 15 mg/kg&loz;) IV given within 30 minutes prior to procedure. Continue 3 to 5 days post-procedure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        All endoscopic procedures with high risk of bacteremia",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         - Immunocompromised patients",
"        </p>",
"        <p>",
"         - Cirrhosis with ascites&bull;",
"        </p>",
"        <p>",
"         - Synthetic vascular graft during first six months after graft placement&Delta; (antibiotic prophylaxis is NOT recommended for nonvalvular cardiovascular devices)",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Amoxicillin 2 grams (pediatric dose 50 mg/kg) orally 30 to 60 minutes before procedure",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ampicillin 2 grams (pediatric dose 50 mg/kg) IV or IM within 30 minutes prior to procedure.",
"        <strong>",
"         If penicillin hypersensitivity:",
"        </strong>",
"        Clindamycin 600 mg (pediatric dose 20 mg/kg) orally 30 to 60 minutes before procedure or IV within 30 minutes prior to procedure.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PEG: percutaneous endoscopic gastrostomy; MRSA: methicillin resistant Staphylococcus aureus; ERCP: endoscopic retrograde cholangiopancreatography; EUS-FNA: endoscopic ultrasound-guided fine-needle aspiration; GI: gastrointestinal.",
"     <br>",
"      * Pediatric dose should generally not exceed adult dose.",
"      <br>",
"       &bull; In patients with cirrhosis and upper gastrointestinal bleeding, antibiotics are indicated even if endoscopy is not planned.",
"       <br>",
"        &Delta; American Heart Association recommendation only. Antimicrobial prophylaxis for synthetic vascular grafts is not recommended by the American Society for Gastrointestinal Endoscopy (ASGE) even if recent (&lt;6 months) graft placement.",
"        <br>",
"         &loz; Use fluoroquinolones cautiously in children.",
"         <br/>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
